import CreateActors from "../Actors/CreateActors";
import EditActors from "../Actors/EditActors";
import IndexActors from "../Actors/IndexActors";
import CreateGenre from "../Genres/CreateGenre";
import EditGenre from "../Genres/EditGenre";
import IndexGenres from "../Genres/IndexGenres";
import HomePage from "../Movies/HomePage";

//centralized route config
const routes = [
    {
        path: "/",
        exact: true,
        component: HomePage,
    },
    {
        path: "/genres",
        exact: true,
        component: IndexGenres,
    },
    {
        path: "/genres/create",
        exact: true,
        component: CreateGenre,
    },
    {
        path: "/genres/edit",
        exact: true,
        component: EditGenre,
    },
    {
        path: "/actors",
        exact: true,
        component: IndexActors,
    },
    {
        path: "/actors/create",
        exact: true,
        component: CreateActors,
    },
    {
        path: "/actors/edit",
        exact: true,
        component: EditActors,
    },

];

export default routes;
